import React from 'react';
import styled from 'styled-components';
import {Box, Button, Grid} from '@material-ui/core'
import s from '../../styles/styles.module.css'
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Spacing from 'react-spacer'

const useStyles = makeStyles((theme) => ({
    root: {
      flexGrow: 1,
    },
    paper: {
      height: 200,
      width: 200,
      padding: theme.spacing(2),
      textAlign: 'center'

    },
    control: {
      padding: theme.spacing(2),
    },
  }));


  export default function Hero() {
    const [spacing, setSpacing] = React.useState(2);
    const classes = useStyles();
    const Text = styled.p`
    color: white;
    text-align: left;
    font-size: 1em;
    margin: 1em;
    padding: 0.25em 1em;
    `
    const BoxHeading = styled.h3`
    text-transform: uppercase;
    `
   return (
            <Box p={2} color="secondary">

              <h1 className={s.header} style={{textAlign: 'center'}}>
              The world's first marketplace for trained artificial intelligence models
              </h1>
              <Spacing height="40px"/>
              <Grid item xs={12}>
        <Grid container justify="center" spacing={spacing}>
            <Grid item>
              <Paper className={classes.paper} >
                  <BoxHeading>data stream</BoxHeading>
             </Paper>
            </Grid>
            <Grid item>
              <Paper className={classes.paper} >
              <BoxHeading>model</BoxHeading>
             </Paper>
            </Grid>
            <Grid item>
              <Paper className={classes.paper} >
              <BoxHeading>results format</BoxHeading>
             </Paper>
            </Grid>

        </Grid>
      </Grid>


              <Button size="large" variant="contained" color="secondary" href="/auth">
                <strong>Get Started</strong>
              </Button>
            </Box>
     )
    }
